CREATE PROCEDURE dbo.proc_transform_352
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_352
    SET payload = LEFT(payload, 1000) + N'|V4-352|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_352;
END
